import "./style/App.css";

function App() {
  return (
    <div className="App">
      <div className="login">
        <h1>Login</h1>
        <form className="form">
          <label>Username</label>
          <input type="text" name="email" id="email"></input>
          <label>Password</label>
          <input type="password" name="password" id="password"></input>
          <button className="submit">Sign In</button>
        </form>
      </div>
    </div>
  );
}

export default App;
